import React, {useContext} from "react";
import Application from "./Application";
import UserProvider, {UserContext} from "./providers/UserProvider.jsx";
import './App.css'
import Navbar from './utils/navbar/Navbar.js';
import Sidebar from './utils/navbar/Sidebar.js';
function App(){


  return(
    <UserProvider className="App">
      <Navbar />
      <Sidebar />
      <Application />
    </UserProvider>


  )

}
export default App;
